import React, {FunctionComponent} from 'react';
import Project from '../models/project';
import {statut} from '../models/statut';

type Props = {
    project: Project
    statut: statut
};

const projectCard: FunctionComponent<Props> = ({project, statut}) => {
    return (
        <div>
            <td>Project leader: {project.ProjectLeader}</td>
            <td>Statut: {statut.valueOf()}</td>
        </div>
   
    )
};

export default projectCard;
